import React from 'react';
import './App.css';
import Header from './Components/Header';
import Footer from './omponents/Footer';
import Home from './pages/Home';

function App() {
  return (
    <div className="App">
      <Header />
      <main>
        <Home />
      </main>
      <Footer />
    </div>
  );
}

export default App;
